import React from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import '../App.css';


function GraphLine() {

    const parameters = {
        series: [
            {
            name: "nbr d heures par semaine",
            data: [2, 4, 1, 3, 6, 4], 
            }
        ],
    }

    return (
        <div>
            <HighchartsReact 
            highcharts={Highcharts} 
            options={parameters} />

            

        </div>
        
        );
    
    }
        export default GraphLine



const options = {
    title: {
        text: 'My stock chart'
    },
    series: [{
        data: [1, 2, 3]
    }]
}


const MyStockChart = () => 
    <HighchartsReact
    highcharts={Highcharts}
    constructorType={'stockChart'}
    options={options}/>
